import { NavLink } from "react-router-dom";

function Nav() {
    return (
        <div className="nav">
            <NavLink to="/about">About</NavLink>
            <NavLink to="/dev">Dev</NavLink>
            <NavLink to="/design">Design</NavLink>
            <NavLink to="/home">Home</NavLink>
        </div>

    )
}

export default Nav;
